import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TreeView from '@material-ui/lab/TreeView';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import ChevronRightIcon from '@material-ui/icons/ChevronRight';
import TreeItem from '@material-ui/lab/TreeItem';

const useStyles = makeStyles({
    root: {
        // height: 216,
        zIndex:1,
        flexGrow: 1,
        maxWidth:120,
    },
});

export default function MultiSelectTreeView(props) {
    const { setNavBarData } = props;

    const Users = [
        { route: "/Dashboard", value: "Users Dashboard" },
        { route: "/CreateUser", value: "Create USER" },
        { route: "/PurchaseOrder", value: "list of users" },
      ]
    
      const Chrome = [
        { route: "/Dashboard", value: "Vendor Dashboard" },
        { route: "/CreateUser", value: "create vendor" },
        { route: "/CreateUser", value: "list of  vendors" },
       
      ]
    
    //   const webStorm = [
    //     { route: "/Dashboard", value: "WSDASH" },
    //     { route: "/CreateUser", value: "WSCU" },
    //     { route: "/PurchaseOrder", value: "WSPO" },
    //     { route: "/Quotation", value: "WSQuotation" },
    //   ]
    
    const classes = useStyles();

    return (

        <TreeView
            className={classes.root}
            defaultCollapseIcon={<ExpandMoreIcon />}
            defaultExpandIcon={<ChevronRightIcon />}
            multiSelect
        >
            <TreeItem nodeId="1" label="Infocenter">
                <TreeItem nodeId="2" label="Users" onClick={()=>setNavBarData(Users)}/>
                <TreeItem nodeId="3" label="Chrome" onClick={()=>setNavBarData(Chrome)}/>
                {/* <TreeItem nodeId="4" label="Webstorm" onClick={()=>setNavBarData(webStorm)}/> */}
            </TreeItem>

        </TreeView>
    );
}
